GO

CREATE TABLE ITRACK_TOKEN (
  CNPJ                  VARCHAR(20) NOT NULL PRIMARY KEY,
  USUARIO               VARCHAR(40) NOT NULL,
  SENHA                 VARCHAR(40),
  NOME                  VARCHAR(60) NOT NULL,
  TOKEN                 VARCHAR(250),
  DT_ATUAL              DATETIME DEFAULT CURRENT_TIMESTAMP,
  VALIDO                INT DEFAULT 0,
);

